import axios from "axios"
import { GET_ERRORS} from "./types";

export const getBookings = expertId => dispatch => {
    axios
      .post("http://localhost:5000/api/expert/bookings", expertId)
      .then(res => {
        console.log('-----res-------', res);
      })
      .catch(err =>
        dispatch({
          type: GET_ERRORS,
          payload: err.response.data
        })
      );
  };
